import React from 'react';

const Plaintext = (props) => {
    return (
        <section className="box">
            <div className="plaintext">
                <p>PlainText</p>
                <textarea 
                    onChange={props.changed}
                    value={props.plaintext}
                    name="plaintext" />
            </div>
        </section>
    );
}

export default Plaintext;
